import React from 'react';

function Navbar() {
  return (
    <nav>
      <a href="#about">About Me</a>
      <a href="#skills">Skills</a>
      <a href="#work">Work Experience</a>
      <a href="#projects">Projects</a>
      <a href="#contact">Contact Me</a>
    </nav>
  );
}

export default Navbar;
